INSERT INTO `aboutus` (`id`, `name`, `content_en`, `content_he`, `content_ar`, `created_at`, `updated_at`) VALUES
(1, 'About us', 'Rates', 'מחירון', 'الاسعار', '2019-08-01 10:00:54', '2019-08-01 15:00:54'),
(2, 'Home', 'Home', 'דף הבית', 'الصفحة الرئيسية', '2019-07-31 14:42:18', '2019-07-31 19:42:18'),
(3, 'About us', 'About us', 'אודותינו', 'عنا', '2019-07-31 14:42:18', '2019-07-31 19:42:18'),
(4, 'About G B Tours', 'About G B Tours', 'About G B Tours', 'حول جي بي تورز', '2019-07-31 14:42:18', '2019-07-31 19:42:18'),
(5, 'description', 'G. Me. Torres is a private company that is very Founded in 1943, started out as a small company with tax per mini-buses and grew until it became a two companies\r\n\r\nParent company Ji. Me. Tours Ltd., which provides public transportation services .\r\n\r\nAnd the subsidiary Jay. Me. Tourist services Ltd, which provides services for special trips, tours, transportation of enterprises, inbound tourism and domestic tourism.\r\n\r\nG. Me. Tours currently operates 18 public transportation lines serving residents of Nazareth and the surrounding area.\r\n\r\nG. Me. Tourist Services Ltd. provides transportation services to factories in the region, special trips and trips to schools, institutions and families including auxiliary services such as person-nights, entrances to sites, security guards, paramedics, etc.\r\n\r\nWe are in the company of G. Me. We are proud of the service that our clients provide to the public\r\n\r\nPassengers and the population of the region, in the new and luxurious buses that we provide,\r\n\r\nAnd with courteous and skilled drivers with safe driving on the road and a pleasant and quiet ride to all\r\n\r\nLength of the road.\r\n\r\nMost importantly, this is the warm attitude you receive when you enter and visit the', 'ג\'י. בי. טורס היא חברה פרטית שהוקמה מאוד בשנת 1943, החלה את דרכה כחברה קטנה עם מס לכל מיני אוטובוסים וגדלה עד שהפכה לשתי חברות\r\nחברת ההורים ג\'י. בי. טורס בע\"מ המספקת שירותי תחבורה ציבורית.\r\n\r\nוהחברה הבת ג\'י. בי.  שירותי תיירות בע\"מ המספקת שירותים לטיולים מיוחדים, סיורים, הסעות מפעלים, תיירות נכנסת ותיירות פנים.\r\n\r\nג\'י. בי.  טורס מפעילה כיום 20 קווי תחבורה ציבורית המשרתים את תושבי נצרת והסביבה.\r\n\r\nג\'י. בי. שירותי תיירות בע\"מ מספקת שירותי הסעות למפעלים באזור, טיולים וטיולים מיוחדים לבתי ספר, מוסדות ומשפחות הכוללים שירותי עזר כמו לילות לינתיים, כניסות לאתרים, מאבטחים, חובשים וכו \'. אנחנו בחברת ג\'י. בי.  אנו גאים בשירות שהעובדים שלנו מספקים לציבור נוסעים ואוכלוסיית האזור, באוטובוסים המפוארים החדשים שאנו מספקים, הועם נהגים אדיבים ומיומנים עם נהיגה בטוחה על הכביש ונסיעה נעימה ושקטה לכולם אורך הדרך.\r\n\r\nוהכי חשוב, זו היחס החם שאתה מקבל כשאתה נכנס לביקור ב', NULL, '2019-08-03 07:18:28', '2019-08-03 12:18:28'),
(6, 'WHY BOOK WITH US?', 'WHY BOOK WITH US?', 'למה כדאי לעבוד איתנו?', NULL, '2019-07-25 21:28:35', '2019-07-26 02:28:35'),
