(2, 'news description', 'id Aladdha 11-13 / 08/2019: Lines 24, 25, 26, 27: Three holiday days are discontinued.\r\nLines 32 and 288: Activity is interrupted during the three holiday days.\r\nQue 331 in The three days of the holiday in Saturday format.\r\nLine 333 from Nazareth to the Technion and the University of Haifa The activity varies for the third day of the holiday according to the above detail:\r\nDirection: Lower the following trips: 6:35, 6:45, 8:30.\r\nReturn direction: Lower the following trips: 15:55, 17:50, 18:15, 19:45.', 'עיד אלאדחא 11-13/08/2019 : קווים 24 , 25 , 26 , 27 : שלושת ימי החג הפעילות מופסקת .\r\nקווים 32 ו 288 : הפעילות מופסקת בשלושת ימי החג .\r\nקוו 331 שלושת ימי החג במתכונת יום שבת.\r\nקו 333 מנצרת לטכניון ולאוניברסיטת חיפה הפעילות משתנה ליום השלישי של החג לפי הפירוט הנ\"ל :\r\nכיוון הלוך : מורידים את הנסיעות הבאות : 6:35 , 06:45 ,  8:30 . \r\nכיוון חזור : מורידים את הנסיעות הבאות :  15:55 , 17:50 , 18:15 , 19:45 .', 'عيد الأضحى 2019/08/11 ل 13 : الخطوط 24 و 25 و 26 و 27: توقيف الخدمات في ثلاثة أيام العيد .\r\nالخطوط 32 و 288 : توقيف الخدمات في ثلاثة أيام العيد.\r\nالخط 331 : في ثلاثة أيام العيد  العمل على أساس السبت.\r\nالخط 333 : من الناصرة إلى التخنيون وجامعة حيفا يختلف النشاط وفقًا للتفاصيل الموضحة أعلاه:\r\nالاتجاه: قمنا بخفض الرحلات التالية: 6:35 ، 6:45 ، 8:30.\r\nاتجاه العودة: قمنا بخفض الرحلات التالية: 15:55 ، 17:50 ، 18:15 ، 19:45.', NULL, '2019-08-12 11:49:47'),
