(8, 'desc6', 'Information materials: Bulletin of the Eastern Galilee, the Golan Heights and the Sea of ​​Galilee (with the metropolis of Haifa and the North).', 'Information materials: Bulletin of the Eastern Galilee, the Golan Heights and the Sea of ​​Galilee (with the metropolis of Haifa and the North).', 'Information materials: Bulletin of the Eastern Galilee, the Golan Heights and the Sea of ​​Galilee (with the metropolis of Haifa and the North).', '2019-07-15 15:35:58', '2019-07-15 22:35:58'),
(9, 'desc7', 'Information materials: Beit She\'an and Afula (with Haifa and Northern Metropolis). Say, combine, passenger now a citizen could purchase a subscription drive zones and to travel, much as he wants, within the region or other regions, all public transport chosen, separately or in combination. Instead of paying for each means of transportation separately. What is the Metropolitan (Regions) method?', 'Information materials: Beit She\'an and Afula (with Haifa and Northern Metropolis). Say, combine, passenger now a citizen could purchase a subscription drive zones and to travel, much as he wants, within the region or other regions, all public transport chosen, separately or in combination. Instead of paying for each means of transportation separately. What is the Metropolitan (Regions) method?', 'There are three types of subscribers:', '2019-07-15 15:41:46', '2019-07-15 22:41:46'),
(10, 'para1', 'The system distributes the public transportation cto 4 metropolitan areas: Haifa, Tel Aviv, Jerusalem and Beersheba.', 'Daily subscription: Free travel subscription valid for the day of purchase only, from the beginning of the service until the end of the service included in the subscription. Bus, train, light rail, matron suit according to the chosen area.', 'The system distributes the public transportation cto 4 metropolitan areas: Haifa, Tel Aviv, Jerusalem and Beersheba.', '2019-07-25 02:54:04', '2019-07-25 07:54:04'),
(11, 'subheading', 'There are three types of subscribers:', 'Weekly Subscription / Flexible 7: Free travel subscription, valid for one week from date of purchase. The validity of the subscription is 7 days from date of purchase, both through the operators and by train purchase.', 'The system distributes the public transportation map to 4 metropolitan areas: Haifa, Tel Aviv, Jerusalem and Beersheba.Each metropolitan area is divided into 3 central ring rings (ring 1), which includes the main city and its surroundings, where most trips are made, and sub-rings (3 + 2) that include several sub-regions, further away from the city center. For the region, purchase a subscription that \"covers\" the selected area (s).', '2019-07-15 15:41:47', '2019-07-15 22:41:47'),
(12, 'subheading', 'Daily subscription: Free travel subscription valid for the day of purchase only, from the beginning of the service until the end of the service included in the subscription. Bus, train, light rail, matron suit according to the chosen area.', 'Free monthly \"30\": subscription to free bus and / or train travel. The validity of the subscription is for a calendar month from the 1st of the month until the end of the month (purchase via public transportation, can be purchased from the 25th of the month).', 'There are three types of subscribers:', '2019-07-15 15:41:47', '2019-07-15 22:41:47'),
(13, 'subheading', 'Weekly Subscription / Flexible 7: Free travel subscription, valid for one week from date of purchase. The validity of the subscription is 7 days from date of purchase, both through the operators and by train purchase.', 'It is still possible to buy a ticket for a 90-minute long-distance commute, allowing the passage of lines (bus lines only at this stage), as exists today.', 'Daily subscription: Free travel subscription valid for the day of purchase only, from the beginning of the service until the end of the service included in the subscription. Bus, train, light rail, matron suit according to the chosen area.', '2019-07-15 15:41:47', '2019-07-15 22:41:47'),
(14, 'subheading', 'Free monthly \"30\": subscription to free bus and / or train travel. The validity of the subscription is for a calendar month from the 1st of the month until the end of the month (purchase via public transportation, can be purchased from the 25th of the month).', 'Old contracts that will be possible for sale after the reform begins:', 'Weekly Subscription / Flexible 7: Free travel subscription, valid for one week from date of purchase. The validity of the subscription is 7 days from date of purchase, both through the operators and by train purchase.', '2019-07-15 15:41:47', '2019-07-15 22:41:47'),
