(24, 'line8', 'It is still possible to purchase a paper ticket for a single trip Transition option.', 'What is accumulated value: * A new travel arrangement that enables the charging of a multi-currency ticket to travel throughout the metropolis * The \"accumulated value\" arrangement can be used for any required travel throughout the Haifa and the valleys metropolitan areas . And an incremental discount depends on the station of the previous trip to the next boarding station according to the reduction table of the desired fare according to the two-hour price table. * The arrangement preserves all existing benefits * Used as a replacement for the tab and as an alternative to charging several travel arrangements at different rates', 'Code 10', '2019-07-15 15:41:47', '2019-07-15 22:41:47'),
