(2, 'description', 'welcome to the official website of GB Tours. GB Tours is a very well established company founded in 1943. We will be happy to show you our services through our improved website for your convenience. Hours of work at our office and call center on Monday, Tuesday, and Friday: 08:00 to 18:00 on Wednesdays and Saturdays: 08:00 to 14:00 Telephone: 04-6036100', 'ברוכים הבאים לאתר הרשמי של ג\'י בי טורס. GB טורס היא חברה אשר הוקמה בשנת 1943. נשמח להציג את שירותינו באמצעות אתר האינטרנט המשופר לנוחותך. שעות עבודה במשרדינו ובמוקד הטלפוניה בימים שני, שלישי ויום שישי בין השעות 08:00-18:00 בימי רביעי ושבת: 08:00-14:00 טלפון: 04-6036100', 'تأسست الشركة في عام 1943. سنكون سعداء لتظهر لك خدماتنا من خلال موقعنا المحسن لراحتك. ساعات العمل في مكتبنا ومركز الاتصال يومي الاثنين والثلاثاء والجمعة: من الساعة 8:00 صباحًا حتى الساعة 18:00 مساءً يومي الأربعاء والسبت: من الساعة 8:00 صباحًا حتى الساعة 14:00 ظهراً: 6036100-04', NULL, '2019-08-02 12:32:25'),
